import React from 'react';
import styles from './component.module.css';

class Pricing extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className={`container ${styles.marginTop}`}>
                <h1>Pricing</h1>
            </div>
        )
    }
}


export default Pricing;
